import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import "./App.css";
import Header from "./components/Header/Header";

function App() {
  return (
    <div className="App-container">
        <BrowserRouter>
          <Header />
          <Routes><Route path="/" element={<HomePage />} /></Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
